webpackJsonp([158],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-return-statement.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p><a href="https://docs.python.org/3/reference/simple_stmts.html#the-return-statement">Python Docs</a></p>\n<p>All functions return a value when called.</p>\n<p>If a return statement is followed by an expression list, that expression list is evaluated and the value is returned:</p>\n<pre><code>>>> def greater_than_1(n):\n...     return n > 1\n...\n>>> print(greater_than_1(1))\nFalse\n>>> print(greater_than_1(2))\nTrue\n</code></pre>\n<p>If no expression list is specified, <code>None</code> is returned:</p>\n<pre><code>>>> def no_expression_list():\n...     return    # No return expression list.\n...\n>>> print(no_expression_list())\nNone\n</code></pre>\n<p>If a return statement is reached during the execution of a function, the current function call is left at that point:</p>\n<pre><code>>>> def return_middle():\n...     a = 1\n...     return a\n...     a = 2     # This assignment is never reached.\n...\n>>> print(return_middle())\n1\n</code></pre>\n<p>If there is no return statement the function returns None when it reaches the end:</p>\n<pre><code>>>> def no_return():\n...     pass     # No return statement.\n...\n>>> print(no_return())\nNone\n</code></pre>',frontmatter:{title:"Python Return Statement",parent:"/home/stuart/guides/src/pages/articles/python/python-return-statement/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-return-statement/"}}}});
